package divya.com;

public class StringNull {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		String s="";
		StringNull ob=null;
		
		if(ob==null) {
			System.out.println("NULL");
		}
		else {
			System.out.println("NOT NULL");
		}
		int l=s.length();
		System.out.println("length "+l);
	}

}
